import React, { useEffect, useState } from "react";
import { Bar } from "react-chartjs-2";
import { useNavigate } from "react-router-dom";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js";

ChartJS.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

function DashboardPage() {
  const [history, setHistory] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const saved = JSON.parse(localStorage.getItem("predictionHistory")) || [];
    setHistory(saved);
  }, []);

  if (history.length === 0) {
    return (
      <div style={styles.empty}>
        <h2>No data yet üìâ</h2>
        <p>Go to the prediction form and generate some results first!</p>
      </div>
    );
  }

  const labels = history.map((item) => `${item.Crop} (${item.Year})`);
  const yields = history.map((item) => item.predicted_yield);

  const chartData = {
    labels,
    datasets: [
      {
        label: "Predicted Yield (tons/hectare)",
        data: yields,
        backgroundColor: "rgba(102, 187, 106, 0.6)",
        borderColor: "#2E7D32",
        borderWidth: 1,
        borderRadius: 6,
      },
    ],
  };

  const avgRainfall =
    history.reduce((sum, item) => sum + item.Rainfall, 0) / history.length;
  const avgTemp =
    history.reduce((sum, item) => sum + item.Avg_Temperature, 0) / history.length;

  const mostCommonCrop = Object.entries(
    history.reduce((acc, item) => {
      acc[item.Crop] = (acc[item.Crop] || 0) + 1;
      return acc;
    }, {})
  ).sort((a, b) => b[1] - a[1])[0][0];

  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>üìä Yield Dashboard</h2>

      <div style={styles.chartCard}>
        <Bar data={chartData} />
      </div>

      <div style={styles.summaryContainer}>
        <div style={styles.card}>
          <h3>üåæ Common Crop</h3>
          <p>{mostCommonCrop}</p>
        </div>
        <div style={styles.card}>
          <h3>üåßÔ∏è Avg Rainfall</h3>
          <p>{avgRainfall.toFixed(1)} mm</p>
        </div>
        <div style={styles.card}>
          <h3>üå°Ô∏è Avg Temperature</h3>
          <p>{avgTemp.toFixed(1)} ¬∞C</p>
        </div>
      </div>

      <div style={styles.buttonContainer}>
        <button onClick={() => navigate("/schemes")} style={styles.btn}>
          üåø Government Schemes
        </button>
        <button onClick={() => navigate("/profit-loss")} style={styles.btn}>
          üíπ Profit‚ÄìLoss Analysis
        </button>
      </div>
    </div>
  );
}

const styles = {
  container: {
    maxWidth: "950px",
    margin: "50px auto",
    padding: "30px",
    background: "linear-gradient(180deg, #F1F8E9, #ffffff)",
    borderRadius: "20px",
    boxShadow: "0 8px 25px rgba(0,0,0,0.08)",
    fontFamily: "'Poppins', sans-serif",
    transition: "all 0.3s ease",
  },

  heading: {
    textAlign: "center",
    color: "#2E7D32",
    fontSize: "28px",
    marginBottom: "30px",
    fontWeight: "700",
  },

  empty: {
    textAlign: "center",
    marginTop: "80px",
    color: "#388E3C",
    fontSize: "18px",
  },

  chartCard: {
    padding: "20px",
    background: "#FAFAFA",
    borderRadius: "16px",
    boxShadow: "0 4px 18px rgba(0,0,0,0.05)",
    marginBottom: "40px",
  },

  summaryContainer: {
    display: "flex",
    justifyContent: "space-between",
    gap: "20px",
    flexWrap: "wrap",
    marginBottom: "30px",
  },

  card: {
    flex: "1",
    minWidth: "200px",
    background: "#E8F5E9",
    borderRadius: "16px",
    padding: "20px",
    textAlign: "center",
    boxShadow: "0 6px 20px rgba(0,0,0,0.08)",
    transition: "transform 0.3s ease, box-shadow 0.3s ease",
  },

  buttonContainer: {
    display: "flex",
    justifyContent: "center",
    gap: "20px",
    flexWrap: "wrap",
  },

  btn: {
    background: "linear-gradient(90deg, #66BB6A, #81C784)",
    color: "white",
    border: "none",
    padding: "12px 25px",
    borderRadius: "12px",
    cursor: "pointer",
    fontSize: "16px",
    fontWeight: "600",
    transition: "all 0.3s ease",
  },
};

export default DashboardPage;
